sys_variable_value.value:
(function execute(inputs, outputs) {
  if(inputs.responseBody) {
  	var sessionArray = JSON.parse(inputs.responseBody);
  	if(sessionArray) {

      var sessions = [];

//		gs.info('Object count: ' + sessionArray.length);

		for (var i = 0; i < sessionArray.length; i++) {
 			var sessionObject = sessionArray[i];
          var session = {};

          session.id = sessionObject.id;
          session.clientBuild = sessionObject.clientBuild;
          session.connectionType = sessionObject.connectionType;
          session.domain = sessionObject.domain;
          session.duration = sessionObject.duration;
          session.loginStatus = sessionObject.loginStatus;
          session.lastActiveTime = sessionObject.lastActiveTime;
          session.loginTime = sessionObject.loginTime;
          session.poolId = sessionObject.poolId;
          session.protocol = sessionObject.protocol;
          session.userAgentOrHostOsName = sessionObject.userAgentOrHostOsName;
          session.userId = sessionObject.userId;
          session.userName = sessionObject.userName;
          session.vmId = sessionObject.vmId;
          session.vmName = sessionObject.vmName;

          sessions.push(session);
		}   

      outputs.sessionarray = sessions;

    }

  }


})(inputs, outputs);

